function effet() {
    console.log("coucou")
    const canvas1 = document.getElementById('canvas1');
    const ctx1 = canvas1.getContext('2d');


    ctx1.drawImage(myImage1, 0, 0, canvas1.width, canvas1.height);
    const pixels = ctx1.getImageData(0, 0, canvas1.width, canvas1.height);


    let particlesArray = [];
    const numberOfParticles = 5000;

    //disparition instantanée de l'image
    ctx1.clearRect(0, 0, canvas1.width, canvas1.height);

    //map de l'image
    let mappedImage = [];
    for (let y = 0; y < canvas1.height; y++) {
        let row = [];
        for (let x = 0; x < canvas1.width; x++) {
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [
                cellBrightness = brightness,
                cellColor = 'rgb(' + red + ',' + green + ',' + blue + ')'

            ];
            row.push(cell);
        }
        mappedImage.push(row);
    }
    console.log(mappedImage);


    function calculateRelativeBrightness(red, green, blue) {
        return Math.sqrt(
            (red * red) * 0.299 +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
        ) / 100;
    }
    class Particles {
        constructor() {
            this.x = Math.random() * canvas1.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 6.5;
            this.size = Math.random() * 2.5 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }
        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImage[this.position1][this.position2][0];
            let movement = (2.5 - this.speed) + this.velocity * 0.5;

            this.y += this.velocity;
            if (this.y >= canvas1.height) {
                this.y = 0;
                this.x = Math.random() * canvas1.width;
            }
        }
        draw() {
            ctx1.beginPath();
            ctx1.fillStyle = mappedImage[this.position1][this.position2][1];
            ctx1.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx1.fill();
        }
    }

    function init() {
        for (let i = 0; i < numberOfParticles; i++) {
            particlesArray.push(new Particles);
        }
    }
    init();

    function animate() {

        ctx1.globalAlpha = 0;
        ctx1.fillStyle = 'black';
        ctx1.fillRect(0, 0, canvas1.width, canvas1.height);

        for (let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update();
            ctx1.globalAlpha = particlesArray[i].speed / 10;
            particlesArray[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate();
}